Writers Against the War on Gaza
@wawog_now
@TheAtlantic published a justification for the murder of Palestinian children today. 
Screenshot:
“…calculated risk. Even when conducted legally, war is ugly. It is possible to kill children legally, if for example one is being attacked by an enemy who hides behind them. But the sight of a legally killed child is no less disturbing than the sight of a murdered one. And Israel has discovered that shutting out the press carries its own risks. An infanticide that no one can see is also going to attract suspicion.”
